Let's think step by step. To add fractions, they need to have a common denominator. The denominators here are $x-3$ and $x+8$, so the least common multiple of these expressions is $(x-3)(x+8)$. Using this fact, we can rewrite each fraction as \begin{align*}
    \frac{C}{x-3}&=\frac{C(x+8)}{(x-3)(x+8)},\\
    \frac{D}{x+8}&=\frac{D(x-3)}{(x-3)(x+8)}.
\end{align*}Then our original equation becomes \begin{align*}
    \frac{C(x+8)}{(x-3)(x+8)}+\frac{D(x-3)}{(x-3)(x+8)}&=\frac{4x-23}{(x-3)(x+8)}
\end{align*}Canceling out the denominators yields $$C(x+8)+D(x-3)=4x-23.$$Now it is convenient to expand this and group like terms together:$$Cx+8C+Dx-3D=4x-23.$
